import React from "react";
import { CiEdit } from "react-icons/ci";
import { CiTrash } from "react-icons/ci";

function WordsList() {
  return (
    <div className=" w-full h-full overflow-auto">
      <div className=" flex w-full content-around">
        <div className=" flex">
          <p>TR:</p>
          <p className=" ml-1">Ahmet</p>
          <p className=" ml-10">EN:</p>
          <p className=" ml-1">Can</p>
        </div>
        <div className=" flex w-full">
          <div className=" w-[25px] h-[25px] bg-green-600">
            <CiEdit className=" w-full h-full" />
          </div>
          <div className=" w-[25px] h-[25px] bg-red-600">
            <CiTrash className="w-full h-full" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default WordsList;
